selector_to_html = {"a[href=\"#wireless-mode\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo sem fio<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Link to this heading\">#</a></h1><p>Este modo usa o 2. Banda de frequ\u00eancia GHz para transmiss\u00e3o de dados e depende da tecnologia de frequ\u00eancia de r\u00e1dio (FR), que conecta ao computador atrav\u00e9s de um receptor USB e permite que o scanner mova-se livremente a uma certa dist\u00e2ncia.</p>", "a[href=\"#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pareamento Um-para-\u00fanico<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidade de Transmiss\u00e3o do Teclado Receito<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#id2\"]": "<aside class=\"footnote brackets\" id=\"id2\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id1\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p>Apenas aplic\u00e1vel para RF Dongle com FWVerL e vers\u00f5es acima. Note que a velocidade do scanner e do receptor devem corresponder, caso contr\u00e1rio podem ocorrer erros ao transmitir c\u00f3digos de barras longos.</p>\n</aside>", "a[href=\"#id5\"]": "<figure class=\"align-center\" id=\"id5\">\n<a class=\"reference internal image-reference\" href=\"../../media/2523IFSNO241.png\"><img alt=\"../../media/2523IFSNO241.png\" src=\"../../media/2523IFSNO241.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\"><code class=\"docutils literal notranslate\"><span class=\"pre\">*</span></code> Modo sem fio</span><a class=\"headerlink\" href=\"#id5\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id6\"]": "<figure class=\"align-center\" id=\"id6\">\n<a class=\"reference internal image-reference\" href=\"../../media/24RF23CH02.png\"><img alt=\"../../media/24RF23CH02.png\" src=\"../../media/24RF23CH02.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Pareamento Um-para-\u00fanico</span><a class=\"headerlink\" href=\"#id6\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id8\"]": "<figure class=\"align-center\" id=\"id8\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY.png\"><img alt=\"../../media/24USB23KEY.png\" src=\"../../media/24USB23KEY.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Alta velocidade</span><a class=\"headerlink\" href=\"#id8\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id7\"]": "<figure class=\"align-center\" id=\"id7\">\n<a class=\"reference internal image-reference\" href=\"../../media/25KB23SP.png\"><img alt=\"../../media/25KB23SP.png\" src=\"../../media/25KB23SP.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Obtenha Velocidade de Transmiss\u00e3o do Teclado Receptor<a class=\"footnote-reference brackets\" href=\"#id4\" id=\"id3\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>2<span class=\"fn-bracket\">]</span></a></span><a class=\"headerlink\" href=\"#id7\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id9\"]": "<figure class=\"align-center\" id=\"id9\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY4.png\"><img alt=\"../../media/24USB23KEY4.png\" src=\"../../media/24USB23KEY4.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Velocidade M\u00e9dia</span><a class=\"headerlink\" href=\"#id9\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id10\"]": "<figure class=\"align-center\" id=\"id10\">\n<a class=\"reference internal image-reference\" href=\"../../media/24USB23KEY9.png\"><img alt=\"../../media/24USB23KEY9.png\" src=\"../../media/24USB23KEY9.png\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Baixa velocidade</span><a class=\"headerlink\" href=\"#id10\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id4\"]": "<aside class=\"footnote brackets\" id=\"id4\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id3\" role=\"doc-backlink\">2</a><span class=\"fn-bracket\">]</span></span>\n<p>S\u00f3 \u00e9 v\u00e1lido no modo 2.4G sem fio e quando o destinat\u00e1rio est\u00e1 recebendo normalmente.</p>\n</aside>", "a[href=\"#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Baixa velocidade<a class=\"headerlink\" href=\"#low-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Alta velocidade<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidade M\u00e9dia<a class=\"headerlink\" href=\"#medium-speed\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
